[{"operationName":"semiPersonalizedRecommendationsQuery","variables":{"id":"people-who-viewed-converted-cdp-algo$course~LCKZ7fqtEeaWeRKby6Zgfg$no_attribute"},"query":"query semiPersonalizedRecommendationsQuery($id: String!) {
  SemiPersonalizedRecsModulesV1Resource {
    get(id: $id) {
      id
      entities {
        entityId
        __typename
      }
      courses {
        elements {
          s12ns {
            elements {
              id
              __typename
            }
            __typename
          }
          id
          slug
          name
          partnerIds
          photoUrl
          partners {
            elements {
              id
              name
              squareLogo
              __typename
            }
            __typename
          }
          courseTypeMetadata {
            courseTypeMetadata {
              ...RhymeProjectFragment
              __typename
            }
            __typename
          }
          __typename
        }
        __typename
      }
      s12ns {
        elements {
          id
          name
          productVariant
          courses {
            paging {
              total
              __typename
            }
            __typename
          }
          logo
          partners {
            elements {
              id
              name
              squareLogo
              __typename
            }
            __typename
          }
          slug
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}

fragment RhymeProjectFragment on CourseTypeMetadataV1_rhymeProjectMember {
  ... on CourseTypeMetadataV1_rhymeProjectMember {
    rhymeProject {
      typeNameIndex
      __typename
    }
    __typename
  }
  __typename
}
"},{"operationName":"coursesQuery","variables":{"courseIds":["EY1eYhVKEeeWtArT3kwAZg","8-JPZRLyEeeS1Q6nmkO4ig","D3N8dyBiEeecWRJ5VaDnfA","tST5SWCsEeeRBg6DrzW1mg"]},"query":"query coursesQuery($courseIds: [String!]!) {
  CoursesV1Resource {
    multiGet(ids: $courseIds) {
      elements {
        id
        slug
        name
        partnerIds
        photoUrl
        partners {
          elements {
            id
            name
            squareLogo
            __typename
          }
          __typename
        }
        __typename
      }
      __typename
    }
    __typename
  }
}
"}]
